import React, { Component } from "react";

class Table extends Component {
  render() {
    return (
      <table>
        <thead>
          <tr>
            <th>Student Names:</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>Student Name</td>
          </tr>
        </tbody>
      </table>
    );
  }
}

export default Table;
